import React from 'react';

function Register(props) {
    return(
        <div>
            <h2>Register</h2>
            <form>
                <label>username</label><br/>
                <input type="text"></input><br/>
                <label>password</label><br/>
                <input type="text"></input><br/><br/>
                <input type="submit"></input>
            </form>
        </div>
    )
}

export default Register;
